import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import FormHelperText from '@material-ui/core/FormHelperText';

function OriVASP() {
    return (
      <div>
        <FormHelperText>Originator VASP code</FormHelperText>
        <TextField id="oriCode" placeholder="-"
          InputLabelProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

function BeneVASP() {
    return (
      <div>
        <FormHelperText>Beneficiary VASP code</FormHelperText>
        <TextField id="beneCode" placeholder="-"
          InputLabelProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

function Result() {
    return (
      <div>
        <FormHelperText>Beneficiary VASP code</FormHelperText>
        <TextField id="result" placeholder="-"
          InputLabelProps={{ shrink: true, readOnly: true, }} classes={{
          root: classes.root, label: classes.label, }}  />
      </div>
    );
}

const useStyles = makeStyles((theme) => ({
    root: {
      border: '1px solid #666' ,
      padding: '30px 20px',
    }
}));

function Bridge() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <form action="">
                <OriVASP />
                <BeneVASP />
                <Result />
            </form>
        </div>
    );
}

export default Bridge;
